import React from 'react';

// Import elements
import {
    Banner,
    ArticleWrapper,
    ArticleTitle,
    ArticleSubTitle,
} from './elements';

const ArticleInner = () => {
    return (
        <>
            <main>

                {/* Banner */}
                <Banner />

                {/* Article content */}
                <ArticleWrapper>
                    <ArticleTitle>

                    </ArticleTitle>
                </ArticleWrapper>


                <ArticleSubTitle>
                    And what we use for our trading platform
                </ArticleSubTitle>
            </main>
        </>
    )
}

export default ArticleInner;
